CREATE FUNCTION public.log_order_status_change() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  -- Variable to hold the user ID, attempting to cast from session variable
  log_user_id UUID := NULL;
BEGIN
  -- Attempt to get the user ID from the session variable 'm3nexus.user_id'
  -- The 'TRUE' argument suppresses errors if the variable is not set
  -- We explicitly cast it to UUID
  BEGIN
    log_user_id := current_setting('m3nexus.user_id', TRUE)::UUID;
  EXCEPTION
    WHEN OTHERS THEN
      -- If current_setting fails (e.g., variable not set or invalid UUID format),
      -- log_user_id remains NULL, and we log a notice (optional)
      RAISE NOTICE 'Session variable m3nexus.user_id not set or invalid. Logging status change with NULL user_id.';
      log_user_id := NULL;
  END;

  -- Insert a new record into the OrderStatusHistory table
  VALUES(NEW.id, NEW.status_id, log_user_id, NULL); -- Notes can be added later if needed

  -- The trigger runs AFTER the update, so we return NULL (standard practice for AFTER triggers)
  RETURN NULL;
END;
$$;


