CREATE VIEW public."LatestBudgetStatusHistory" AS
 SELECT DISTINCT ON (bsh.component_budget_id) bsh.id,
    bsh.component_budget_id,
    bsh.status_id,
    bs.title AS status_title,
    bs.description AS status_description,
    bs."order" AS status_order,
    bsh.user_id,
    u.name AS user_name,
    u.surname AS user_surname,
    bsh.notes,
    bsh.change_timestamp
   FROM ((public."BudgetStatusHistory" bsh
     LEFT JOIN public."BudgetStatus" bs ON ((bsh.status_id = bs.id)))
     LEFT JOIN public."User" u ON ((bsh.user_id = u.id)))
  ORDER BY bsh.component_budget_id, bsh.change_timestamp DESC;


