-- Name: VW_ComponentBudget_Detail; Type: VIEW; Schema: public; Owner: neondb_owner
--

CREATE VIEW public."VW_ComponentBudget_Detail" AS
 SELECT cb.id AS component_budget_id,
    cb.created_at AS budget_created_at,
    cb.updated_at AS budget_updated_at,
    cb.submission_mode,
    (((u.name)::text || ' '::text) || (u.surname)::text) AS submitted_by_name,
    cb.forge_id,
    (((fu.name)::text || ' '::text) || (fu.surname)::text) AS forge_user_name,
    cb.component_id,
    c.title AS component_title,
    c.component_base_id,
    c.version,
    c.status_id AS component_status_id,
    cs.title AS component_status_title,
    cb.status_id AS budget_status_id,
    bs.title AS budget_status_title,
    cb.client_id,
    cd.user_id AS client_user_id,
    (((cu.name)::text || ' '::text) || (cu.surname)::text) AS client_name,
    oc.order_id,
    o.title AS order_title,
    o.order_onedrive_folder_id,
    c.machine_id AS component_machine_id,
    cb.support_material_id,
    m.name AS support_material_name,
    cb.support_g_per_table,
    cb.items_per_table,
    cb.print_min_per_table,
    cb.g_per_table,
    cb.modeling_min,
    cb.slicing_min,
    cb.maintenance_min_per_table,
    cb.curing_machine_id,
    mc.model AS curing_machine_model,
    cb.curing_min,
    cb.curing_items_per_table,
    cb.curing_min_edited,
    cb.total_value,
    cb.final_price_per_piece,
    cb.internal_notes,
    cb.client_notes,
    bsh_latest.status_id AS latest_history_status_id,
    bs2.title AS latest_history_status_title,
    bsh_latest.change_timestamp AS latest_history_change_timestamp,
    (bsh_latest.status_id IS NOT NULL) AS has_status_history,
    (files_count.cnt > 0) AS has_files,
    (fin_count.cnt > 0) AS has_finishings,
    (mat_count.cnt > 0) AS has_finishing_materials,
    (o.id IS NOT NULL) AS has_order_link,
    (cb.client_id IS NOT NULL) AS has_client_link,
    ((cb.items_per_table IS NOT NULL) OR (cb.print_min_per_table IS NOT NULL) OR (cb.g_per_table IS NOT NULL)) AS has_production_fields,
    ((cb.curing_machine_id IS NOT NULL) OR (COALESCE(cb.curing_min, 0) > 0) OR (cb.curing_items_per_table IS NOT NULL)) AS has_curing_fields,
    (COALESCE(support_opts.cnt, (0)::bigint))::integer AS support_options_count,
    (COALESCE(cure_opts.cnt, (0)::bigint))::integer AS curing_options_count,
    (COALESCE(support_opts.cnt, (0)::bigint) > 0) AS support_expected,
    (COALESCE(cure_opts.cnt, (0)::bigint) > 0) AS curing_expected,
    (COALESCE(support_opts.cnt, (0)::bigint) = 0) AS support_fields_null_ok,
    (COALESCE(cure_opts.cnt, (0)::bigint) = 0) AS curing_fields_null_ok,
    ((COALESCE(support_opts.cnt, (0)::bigint) > 0) AND ((cb.support_material_id IS NULL) OR (cb.support_g_per_table IS NULL))) AS support_suspect_missing,
    ((COALESCE(support_opts.cnt, (0)::bigint) = 0) AND ((cb.support_material_id IS NOT NULL) OR (cb.support_g_per_table IS NOT NULL))) AS support_unexpected_values,
    ((COALESCE(cure_opts.cnt, (0)::bigint) > 0) AND ((cb.curing_machine_id IS NULL) OR (COALESCE(cb.curing_min, 0) = 0) OR (cb.curing_items_per_table IS NULL))) AS curing_suspect_missing,
    ((COALESCE(cure_opts.cnt, (0)::bigint) = 0) AND ((cb.curing_machine_id IS NOT NULL) OR (COALESCE(cb.curing_min, 0) > 0) OR (cb.curing_items_per_table IS NOT NULL))) AS curing_unexpected_values,
    cure_rec.cure_minutes AS recommended_cure_minutes,
    cure_rec.machine_model AS recommended_cure_machine_model,
    (COALESCE(files_count.cnt, (0)::bigint))::integer AS files_count,
    (COALESCE(fin_count.cnt, (0)::bigint))::integer AS finishings_count,
    (COALESCE(mat_count.cnt, (0)::bigint))::integer AS materials_count,
    COALESCE(files_agg.files, '[]'::json) AS files,
    COALESCE(fin_agg.finishings, '[]'::json) AS finishings
   FROM ((((((((((((((((((((((public."ComponentBudget" cb
     LEFT JOIN public."User" u ON ((u.id = cb.forge_id)))
     LEFT JOIN public."UserData" fud ON ((fud.user_id = cb.forge_id)))
     LEFT JOIN public."User" fu ON ((fu.id = fud.user_id)))
     LEFT JOIN public."Component" c ON ((c.id = cb.component_id)))
     LEFT JOIN public."ComponentStatus" cs ON ((cs.id = c.status_id)))
     LEFT JOIN public."BudgetStatus" bs ON ((bs.id = cb.status_id)))
     LEFT JOIN public."ClientData" cd ON ((cd.user_id = cb.client_id)))
     LEFT JOIN public."User" cu ON ((cu.id = cd.user_id)))
     LEFT JOIN LATERAL ( SELECT oc1.order_id
           FROM public."Order_Component" oc1
          WHERE (oc1.component_id = cb.component_id)
          ORDER BY oc1.created_at DESC
         LIMIT 1) oc ON (true))
     LEFT JOIN public."Order" o ON ((o.id = oc.order_id)))
     LEFT JOIN public."Material" m ON ((m.id = cb.support_material_id)))
     LEFT JOIN public."MachineCure" mc ON ((mc.id = cb.curing_machine_id)))
     LEFT JOIN LATERAL ( SELECT count(*) AS cnt
           FROM public."Material_Machine" mm
          WHERE ((mm.machine_id = c.machine_id) AND (mm.material_id <> c.material_id))) support_opts ON (true))
     LEFT JOIN LATERAL ( SELECT count(*) AS cnt
           FROM public."Material_MachineCure" mmc
          WHERE (mmc.material_id = c.material_id)) cure_opts ON (true))
     LEFT JOIN LATERAL ( SELECT mmc.cure_minutes,
            mc2.model AS machine_model
           FROM (public."Material_MachineCure" mmc
             JOIN public."MachineCure" mc2 ON ((mc2.id = mmc.machinecure_id)))
          WHERE ((mmc.material_id = c.material_id) AND (mmc.is_recommended = true))
          ORDER BY mmc.cure_minutes
         LIMIT 1) cure_rec ON (true))
     LEFT JOIN LATERAL ( SELECT bsh1.status_id,
            bsh1.change_timestamp
           FROM public."BudgetStatusHistory" bsh1
          WHERE (bsh1.component_budget_id = cb.id)
          ORDER BY bsh1.change_timestamp DESC
         LIMIT 1) bsh_latest ON (true))
     LEFT JOIN public."BudgetStatus" bs2 ON ((bs2.id = bsh_latest.status_id)))
     LEFT JOIN LATERAL ( SELECT count(*) AS cnt
           FROM public."ComponentBudgetFiles" f
          WHERE (f.component_budget_id = cb.id)) files_count ON (true))
     LEFT JOIN LATERAL ( SELECT json_agg(json_build_object('id', f.id, 'file_name', f.file_name, 'file_type', f.file_type, 'budget_category', f.budget_category, 'onedrive_item_id', f.onedrive_item_id, 'onedrive_web_url', f.onedrive_web_url, 'is_profile_image', f.is_profile_image, 'created_at', f.created_at) ORDER BY f.created_at DESC) AS files
           FROM public."ComponentBudgetFiles" f
          WHERE (f.component_budget_id = cb.id)) files_agg ON (true))
     LEFT JOIN LATERAL ( SELECT count(*) AS cnt
           FROM public."ComponentBudgetFinishing" f
          WHERE (f.component_budget_id = cb.id)) fin_count ON (true))
     LEFT JOIN LATERAL ( SELECT count(*) AS cnt
           FROM (public."ComponentBudgetFinishingMaterial" fm
             JOIN public."ComponentBudgetFinishing" f ON ((f.id = fm.component_budget_finishing_id)))
          WHERE (f.component_budget_id = cb.id)) mat_count ON (true))
     LEFT JOIN LATERAL ( SELECT json_agg(json_build_object('id', f.id, 'finishing_id', f.finishing_id, 'total_drying_hours', f.total_drying_hours, 'sequence_override', f.sequence_override, 'notes', f.notes, 'materials', COALESCE(mat_agg.materials, '[]'::json)) ORDER BY f.sequence_override, f.created_at) AS finishings
           FROM (public."ComponentBudgetFinishing" f
             LEFT JOIN LATERAL ( SELECT json_agg(json_build_object('id', fm.id, 'finishing_material_id', fm.finishing_material_id, 'quantity', fm.quantity, 'quantity_uom', fm.quantity_uom, 'application_hours', fm.application_hours, 'unit_cost_snapshot', fm.unit_cost_snapshot, 'currency_snapshot', fm.currency_snapshot, 'brand_name_snapshot', fm.brand_name_snapshot, 'purchase_link_snapshot', fm.purchase_link_snapshot, 'notes', fm.notes) ORDER BY fm.created_at) AS materials
                   FROM public."ComponentBudgetFinishingMaterial" fm
                  WHERE (fm.component_budget_finishing_id = f.id)) mat_agg ON (true))
          WHERE (f.component_budget_id = cb.id)) fin_agg ON (true));


ALTER VIEW public."VW_ComponentBudget_Detail" OWNER TO neondb_owner;

